  const isMobile = useIsMobile();
  return (
    <div  className={` ${isMobile ? "" : "wing-blank-lg"} `}>
      <div className="width-100">
        <div className="space-white-lg"></div>
        <CardButton >V1</CardButton>
        <div className="space-white-lg"></div>
      </div>
    </div>
  );
};

export default Version;
